tables.table_schema:
CREATE TABLE raw_data_cleaning (
    id INT PRIMARY KEY,
    data_entry VARCHAR(255),
    cleaning_method VARCHAR(255),
    cleaned_data TEXT
);

CREATE TABLE Cleaning_Steps (
    step_id INT PRIMARY KEY,
    step_description VARCHAR(255),
    completed BOOLEAN
);

CREATE TABLE Preprocessing_Steps (
    process_id INT PRIMARY KEY,
    process_name VARCHAR(255),
    parameters JSONB
);

CREATE TABLE data_cleaning (
    id UUID PRIMARY KEY,
    raw_data TEXT,
    cleaned_data TEXT,
    preprocessing_steps JSON
);

CREATE TABLE preprocessing_logs (
    log_id UUID PRIMARY KEY,
    cleaned_data_id UUID,
    preprocessing_step VARCHAR,
    timestamp TIMESTAMP
);
